&lt;p&gt;
	Develop high electron mobility transistor (HEMT) amplifier based heterodyne radiometers to provide high sensitivity at millimeter and submillimeter wavelengths with high spectral resolution for molecular line detection.&lt;br /&gt;
	Performance goals are:&lt;br /&gt;
	Low system noise temperature:&lt;br /&gt;
	&amp;lt; 280K Single Sideband at 230 GHz&lt;br /&gt;
	&amp;lt; 650K Single Sideband at 640 GHz&lt;br /&gt;
	Wide spectral coverage:&lt;br /&gt;
	180-270 GHz (for tropospheric measurements)&lt;br /&gt;
	620-660 GHz (stratospheric measurements)&lt;br /&gt;
	Sideband separation:&amp;nbsp; &amp;gt; 15 dB&lt;br /&gt;
	Amplifier front-end operating temperature:&amp;nbsp; 20K&lt;/p&gt;
